import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom";

import Home from "./pages/Home/Home";
import Products from "./pages/Products/Products";
import Product from "./pages/Product/Product";


// Creating the routes
const router = createBrowserRouter([
  {
    // Home page route
    path:"/",
    element:<Home/>
  },
  {
    // Products page route
    path:"/products/:id",
    element:<Products/>
  },
  {
    // Particular Product page route
    path:"/product/:id",
    element:<Product/>
  },

])

function App() {
  return (
    <div>
      <RouterProvider router={router}/>
    </div>
  );
}

export default App;
